import './App.css';
import NavBar from './NavBar';
import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import axios from "axios";

function PatientPage() {
    // Declare state variable to store patient data
    const [patientData, setPatientData] = useState([{}]);
    const [textData, setTextData] = useState({"examId":"",});
    // Use useParams hook to extract patientId from URL
    const { patientId } = useParams();

    // Use useEffect hook to fetch patient data from API on component mount
    useEffect(() => {
        axios
            .get(`http://127.0.0.1:9000/patient/${patientId}`)//`https://czi-covid-lypkrzry4q-uc.a.run.app/api/patient/${patientId}`)
            .then((response) => {
                setPatientData(response.data);
            })
    },[]);

    const deleteExam=(e)=>{
        alert('delete button clicked')
    }
    const updateExam=(e)=>{
        alert('update button clicked')
    }

    return (
        <div className="dataContainer">
            <NavBar />
            {/* Display header with patientId */}
            <h1 style={{ textAlign: "center", marginBottom: "2em" }}>Information For Patient - {patientId}</h1>
            {/* Create table to display patient data */}
            <table style={{ width: "auto", textAlign: "center", marginLeft: "auto", marginRight: "auto" }}>
                <thead>
                    <tr>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>Exam ID</th>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>Image</th>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>Key Findings</th>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>Brixia Score</th>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>Age</th>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>Sex</th>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>BMI</th>
                        <th style={{ borderBottom: "2px solid #ddd", padding: "1em" }}>Zip Code</th>
                    </tr>
                </thead>
                <tbody>
                    {/* Map over patientData array to display each exam data */}
                    {patientData.map((exam) => (

                        <tr style={{ borderBottom: "1px solid #ddd" }}>
                            {/* Display exam data in table cells */}
                            <td style={{ padding: "1em" }}>
                               <textarea name='examId' 
                                         type='text'
                                         placeholder={exam.examId} 
                                         value={textData.examId} 
                                         onChange={e=>{console.log(textData);setTextData({'examId':e.target.value})}} >
                                           {exam.examId} 
                              </textarea> 
                            </td>
                            <td style={{ padding: "1em" }}>
                                <img
                                    className="patientImage"
                                    src={exam.filename}
                                    alt={exam.keyFindings}
                                    style={{ height: "200px", width: "200px", objectFit: "cover" }}
                                />
                            </td>
                            <td style={{ padding: "1em" }}>
                               <textarea name='keyFindings' 
                                         type='text'
                                         placeholder={exam.keyFindings} 
                                         value={textData.keyFindings} 
                                         onChange={e=>{console.log(textData);setTextData({'keyFindings':e.target.value})}} >
                                           {exam.keyFindings}
                              </textarea> 
                            </td>
                            <td style={{ padding: "1em" }}>
                               <textarea name='brixiaScores' 
                                         type='text'
                                         placeholder={exam.brixiaScores} 
                                         value={textData.brixiaScores} 
                                         onChange={e=>{console.log(textData);setTextData({'brixiaScores':e.target.value})}} >
                                           {exam.brixiaScores}
                              </textarea> 
                            </td>
                            <td style={{ padding: "1em" }}>
                               <textarea name='age' 
                                         type='text'
                                         placeholder={exam.age} 
                                         value={textData.age} 
                                         onChange={e=>{console.log(textData);setTextData({'age':e.target.value})}} >
                                           {exam.age}
                              </textarea> 
                            </td>
                            <td style={{ padding: "1em" }}>
                               <textarea name='sex' 
                                         type='text'
                                         placeholder={exam.sex} 
                                         value={textData.sex} 
                                         onChange={e=>{console.log(textData);setTextData({'sex':e.target.value})}} >
                                           {exam.sex}
                              </textarea> 
                            </td>
                            <td style={{ padding: "1em" }}>
                               <textarea name='bmi' 
                                         type='text'
                                         placeholder={exam.bmi} 
                                         value={textData.bmi} 
                                         onChange={e=>{console.log(textData);setTextData({'bmi':e.target.value})}} >
                                           {exam.bmi}
                              </textarea> 
                            </td>
                            <td style={{ padding: "1em" }}>
                               <textarea name='ZipCode' 
                                         type='text'
                                         placeholder={exam.zipCode} 
                                         value={textData.zipCode} 
                                         onChange={e=>{console.log(textData);setTextData({'zipCode':e.target.value})}} >
                                           {exam.zipCode}
                              </textarea> 
                            </td>
            <button >Update </button>
            <button >Delete </button>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );
}

// Export the component be used in other parts of the application
export default PatientPage;
